 import (
 	"context"
 	"fmt"
 	"io"
 	"net/http"

 	"google.golang.org/api/option"
 	"google.golang.org/api/run/v2"
 )

 // printEmptyJSON prints an empty JSON object "{}" to the writer w.
 func printEmptyJSON(w io.Writer) error {
 	// Authorize the client using Application Default Credentials.
 	// See https://g.co/dv/identity/protocols/application-default-credentials
 	ctx := context.Background()
 	httpClient, err := google.DefaultClient(ctx, option.WithScopes(run.CloudPlatformScope))
 	if err != nil {
 		return fmt.Errorf("google.DefaultClient: %v", err)
 	}
 	client, err := run.NewService(ctx, option.WithHTTPClient(httpClient))
 	if err != nil {
 		return fmt.Errorf("run.NewService: %v", err)
 	}

 	req := &run.Empty{}
 	resp, err := client.Projects.Get(req).Do()
 	if err != nil {
 		return fmt.Errorf("Projects.Get (%v): %v", req, err)
 	}

 	if err := resp.WriteJSON(w); err != nil {
 		return fmt.Errorf("WriteJSON: %v", err)
 	}
 	fmt.Fprintln(w)
 	return nil
 }

